// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract will{
    address owner;
    uint256 fortune;
    bool deceased;

    constructor() payable public{  //allowing function to receive and send ether
        owner = msg.sender; //this give address of program initiator
        fortune = msg.value; //this give amount of eth sent
        deceased = false;
    }
    
    //Create a modifier so the person who call the contract is the owner

    modifier onlyOwner{
        require(msg.sender == owner);
        _;
    }

     //Create a modifier so fund is allocated when gramps is deceased

    modifier mustBeDeceased{
        require(deceased == true);
        _;
    }
    //list of family wallets
    address payable  [] familyWallets;

    //map through inheritance
    mapping(address => uint) inheritance;

    //set inheritance for each addresses
    function setInheritance(address payable wallet, uint amount) public onlyOwner{
        familyWallets.push(wallet);
        inheritance[wallet]= amount;
    }

    //Pay each family member on basis of their wallet address
    function payout() private mustBeDeceased{
        for(uint i=0;  i < familyWallets.length; i++){
            familyWallets[i].transfer(inheritance[familyWallets[i]]);
        }
    }

    function Deceased() public onlyOwner {
        deceased = true;
        payout();
    }


}

